  return (
    <>
    <div className="col-md-3">
    <div className="scrollContainer border border-dark" style={{
    // overflowY: "scroll",
    marginTop: "10px",
    padding: "0px",
    marginRight: "-95px"}}>

      <div className="title position-fixed" style={{margin:"0px",padding:"0px",display:"flex",flexDirection: "row",
    justifyContent: "space-between"}}>
        <p style={{fontWeight:"500",marginTop: "13px",
    marginBottom: "0px"}}>Notes</p>
        <button type="button" className="btn btn-primary-outline addingbtn my-2" data-bs-toggle="modal" data-bs-target="#exampleModal">
        <i className="fas fa-right"></i>
        <i className="fas fa-plus"></i>
        <i className="fas fa-trash"></i>
      </button>
      </div>

      </div>
</div>
  </>);
}

export default RuleSection;
